import React, {Fragment} from 'react';

function Paragraph (topic) {
    if (topic == 'About me') {
        return (
            <Fragment>
                <p>Hello, my name is Jack and I'm a third-year computer science student at UTM.</p>
            </Fragment>
        )
    }
    return (
        <Fragment>
            <p>Github link</p>
        </Fragment>
    )
}



export default Paragraph;
